var check_counting_fun = function check_counting_fun() {
  var date_begin = document.querySelector("#begin");
  var date_end = document.querySelector("#end");

  if (date_begin.value == "" || date_end.value == "") {
    alert("Wrong input");
  } else if (Date.parse(date_begin.value) >= Date.parse(date_end.value)) {
    alert("The beginning date cannot over the ending date.");
  } else {
    get_counting_date(date_begin.value, date_end.value);
  }
};

var drawing_graph = function drawing_graph(data) {
  var dates = [];
  var message_nums = [];
  var reply_nums = [];

  for (var idx = 0; idx < data.length; idx++) {
    dates.push(data[idx].date);
    message_nums.push(data[idx].message_num);
    reply_nums.push(data[idx].reply_num);
  }

  Highcharts.chart("graph", {
    chart: {
      type: 'line'
    },
    title: {
      text: 'Numbers of message'
    },
    xAxis: {
      categories: dates
    },
    yAxis: {
      title: {
        text: 'Number',
        size: "16px"
      }
    },
    series: [{
      name: 'New Message Numbers',
      data: message_nums,
      color: "red"
    }, {
      name: 'Reply Message',
      data: reply_nums,
      color: "blue"
    }]
  });
};

